  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:58.363884\",\n\t\"name\": \"mcgrath-headquarters-inventory-proposed-innoko-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"McGrath has several advantages as a possible
  headquarters site for the proposed Innoko Wildlife Refuge. It has a large modern
  runway, good communications, river access, local sources of supplies and services,
  a modern health clinic and school, and a progressive attitude toward such developments.
  Its major disadvantage is that it lies at a greater than desirable distance from
  the proposed refuge. Nevertheless, many McGrath citizens use the Innoko area and
  therefore the headquarters would be near local users. The only alternative sites
  located, closer to the proposal are Grayling and Anvik, both of which lack many
  of the vital facilities like transportation, telephone, medical, school, and recreation
  available in McGrath. However, these villages should be considered as possible sub
  headquarters. Aniak has requested consideration as a site. Its facilities are very
  similar to those in McGrath, but it lies about 100 miles away from the refuge proposal
  and very few of its citizens (only those who are quite wealthy) have any involvement
  in the Innoko area.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
